import React from "react";

const ProgramDetails = () => {
  return (
    <div style={{ padding: "2rem" }}>
      <h1>Program Details</h1>
      <p>
        Our program is designed to provide students with hands-on experience, expert mentorship, and real-world problem-solving opportunities. Participants will explore various STEM fields, develop technical and leadership skills, and engage with a vibrant community of learners and professionals.
      </p>
    </div>
  );
};

export default ProgramDetails;
